import React, { useState, useEffect } from 'react';

const UserDashboard = ({ userId, reservations }) => {
  const [userReservations, setUserReservations] = useState([]);

  useEffect(() => {
    if (reservations && userId) {
      // Filter reservations for the logged-in user
      const filteredReservations = reservations.filter(
        (reservation) => reservation.userId === userId
      );
      setUserReservations(filteredReservations);
    }
  }, [reservations, userId]);

  return (
    <div className="container mx-auto p-8">
      <h1 className="text-4xl font-bold text-gray-800 mb-6 text-center">
        Mis Reservas
      </h1>

      {userReservations.length > 0 ? (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          {userReservations.map((reservation) => (
            <div
              key={reservation.id}
              className="border rounded-lg p-4 bg-white shadow-sm hover:shadow-md transition"
            >
              <h2 className="text-xl font-bold text-gray-800">
                {reservation.spaceName}
              </h2>
              <p className="text-gray-600">Inicio: {reservation.startDate}</p>
              <p className="text-gray-600">Fin: {reservation.endDate}</p>
              <p className="text-blue-500 font-semibold mt-2">
                Total: ${reservation.totalPrice}
              </p>
            </div>
          ))}
        </div>
      ) : (
        <p className="text-center text-gray-500 mt-8">
          No tienes reservas activas.
        </p>
      )}
    </div>
  );
};

export default UserDashboard;
